import React, { Component } from 'react';
import '../App.css';

class Grid extends Component {
    state = {
        grid: new Array(15).map(each => each = new Array(15).fill(0))
    }
    render() {
    return (
      <div className="grid-container">
        {this.state.grid.map(each => {
            return (
                <div className="row">
                    {each.map(cell => {
                        return (
                            <div className="cell">
                            0
                            </div>
                        )
                    })}
                </div>
            )
        })}
      </div>
    );
  }
}

export default Grid;
